import { Image } from 'react-native';

const Puxarimg = () => {
  return (
    <Image
      source={require('../Script/')} // Substitua o caminho pela localização da imagem no seu projeto
      style={{ width: 200, height: 200 }}
    />
  );
};

export default Puxarimg;
